DROP TABLE IF EXISTS aportes.aportes;
CREATE TABLE IF NOT EXISTS aportes.aportes(ID int NOT NULL AUTO_INCREMENT,Nombre VARCHAR(18),Apellido VARCHAR(16),DNI VARCHAR(21),Cuit VARCHAR(23),Tipo VARCHAR(13),Importe NUMERIC(7,1),PRIMARY KEY (ID));
CREATE TABLE IF NOT EXISTS aportes.eventlog(ID int NOT NULL AUTO_INCREMENT, ip VARCHAR(100), request MEDIUMTEXT, PRIMARY KEY (ID));
UPDATE aportes.aportes SET TIPO='DEPOSITO' WHERE TIPO='DEPOSITO' OR TIPO='BANCARIO';
UPDATE aportes.aportes SET TIPO='TRANSFERENCIA' WHERE TIPO='TRANSFERENCIA' OR TIPO='BANCARIA' OR TIPO IS NULL;
DELETE FROM aportes.aportes WHERE IMPORTE IS NULL;
